CREATE OR REPLACE PROCEDURE         FOCUSPP.FCS_CLEAR_SESSION_BATCH IS
BEGIN    
    DELETE FROM APP_USER_LOGGED AUL WHERE TRUNC(MOD(MOD(SYSDATE - AUL.LOGGED_ON,1)*24,1)*60 ) > (SELECT LC.VALUE FROM LOOKUP_CODE LC WHERE LC.TITLE = 'APP_CLEAR_SESSION' AND ROWNUM=1);
    COMMIT;
END;
